import React from "react";
import { Nav } from "react-bootstrap";
import "./Navbar.css";
import Footer from "./Footer";
import { scroller } from "react-scroll";

export default function Navbar() {
  // const scrollToContact = () => {
  //   window.scrollTo({
  //     top: 500,
  //     behavior: "smooth",
  //   });
  // };

  const scrollToSection = () => {
    scroller.scrollTo(
      { Footer },
      {
        duration: 800,
        delay: 0,
        smooth: "easeInOutQuart",
      }
    );
  };

  return (
    <div>
      <Nav className="navBar justify-content-end" activeKey="/home">
        <Nav.Item>
          <Nav.Link className="navItem" href="/home">
            Home
          </Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link className="navItem" eventKey="about">
            About
          </Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link className="navItem" eventKey="portfolio">
            Portfolio
          </Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link
            className="navItem"
            eventKey="contact"
            onClick={scrollToSection}
          >
            Contact
          </Nav.Link>
        </Nav.Item>
      </Nav>
    </div>
  );
}
